import React, { Component } from "react";
import Navbar from "./Navbar";
import { Header, Image, Segment, Container } from "semantic-ui-react";
import { connect } from "react-redux";

class UserProfile extends Component {
  render() {
    const { img_url, first_name, last_name, email } = this.props.auth.user;
    return (
      <div>
        <Navbar />
        <Header
          style={{ position: "fixed", top: "80px", left: "50px" }}
          as="h3"
          content="Text Container"
          textAlign="center"
        >
          <Container>
            <Segment.Group>
              <Segment></Segment>
              <Segment>Content</Segment>
              <Segment>Content</Segment>
              <Segment>Content</Segment>
            </Segment.Group>
          </Container>

          <Grid columns={2}>
      <Grid.Column>
        <Grid columns={2} doubling stackable>
          <Grid.Column>
            <Segment>Content</Segment>
          </Grid.Column>
          <Grid.Column>
            <Segment>Content</Segment>
          </Grid.Column>
        </Grid>
      </Grid.Column>
      <Grid.Column>
        <Grid columns={3} doubling stackable>
          <Grid.Column>
            <Segment>Content</Segment>
          </Grid.Column>
          <Grid.Column>
            <Segment>Content</Segment>
          </Grid.Column>
          <Grid.Column>
            <Segment>Content</Segment>
          </Grid.Column>
        </Grid>
      </Grid.Column>
    </Grid>

        </Header>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    auth: state.auth
  };
};

export default connect(
  mapStateToProps,
  null
)(UserProfile);
